const e=JSON.parse('{"key":"v-029035ea","path":"/train/eda/chip-circuit/Part_5-std_cell/5_2_%E7%89%A9%E7%90%86%E8%AE%BE%E8%AE%A1%E4%B8%AD%E7%9A%84%E6%A0%87%E5%87%86%E5%8D%95%E5%85%83%E5%BA%93.html","title":"5.2 标准单元库","lang":"zh-CN","frontmatter":{"title":"5.2 标准单元库","order":2},"headers":[{"level":2,"title":"预特性化：","slug":"预特性化","link":"#预特性化","children":[]},{"level":2,"title":"多驱动强度单元：","slug":"多驱动强度单元","link":"#多驱动强度单元","children":[]},{"level":2,"title":"多阈值电压 [Vt] 单元：","slug":"多阈值电压-vt-单元","link":"#多阈值电压-vt-单元","children":[]},{"level":2,"title":"物理单元：","slug":"物理单元","link":"#物理单元","children":[]},{"level":2,"title":"单元集合：","slug":"单元集合","link":"#单元集合","children":[]},{"level":2,"title":"文件集合：","slug":"文件集合","link":"#文件集合","children":[]},{"level":2,"title":"参考资料","slug":"参考资料","link":"#参考资料","children":[]}],"git":{"createdTime":1721213548000,"updatedTime":1721213548000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1}]},"readingTime":{"minutes":5.84,"words":1753},"filePathRelative":"train/eda/chip-circuit/Part_5-std_cell/5_2_物理设计中的标准单元库.md","localizedDate":"2024年7月17日","excerpt":"<p>标准单元库是现代ASIC设计流程中不可或缺的一部分，它为设计人员提供了一系列预定义的逻辑单元，可大大缩短设计时间并提高设计的可靠性和性能。在物理设计中，标准单元库起着至关重要的作用，它包含了多样的单元类型，包括具有不同驱动强度和阈值电压的单元，以及一些专用的物理单元。在本文中，我将详细介绍标准单元库的重要内容以及它们在ASIC设计中的应用。</p>\\n<h2> 预特性化：</h2>\\n<p>首先，让我们了解一下标准单元库的预特性化过程。在将单元纳入标准单元库之前，它们要经历一系列严格的设计流程。这个过程包括原理图设计、仿真验证、符号创建、布局设计（遵循标准单元布局规则）、物理验证、抽象、提取和特性化。通过这些步骤，设计人员能够确保标准单元在功能和性能方面都是可靠的，并且符合各种物理设计规则，以便在后续的自动布局和布线（APR）过程中能够顺利使用。</p>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{e as data};
